(11, 'AQUA', 'NORAD ID: 27424 <br>\r\nInt\'l Code: 2002-022A <br>\r\nSemi major axis: 7080 km <br>\r\nEccentricity: 0.0000979 <br>\r\nPerigee: 709.4 km  <br>\r\nApogee: 709.8 km  <br>\r\nInclination: 98.2 degrees <br>\r\nRAAN: 95.2063 degrees <br>\r\nArgument of perigee: 120.4799 degrees <br>\r\nMean anomaly: 351.4268 degrees <br>\r\nMean motion: 14.57 rev/day <br>\r\nPeriod: 98.8 minutes <br>\r\nLaunch date: May 4, 2002 <br>\r\n<span style="text-decoration: underline;"><strong>Mission description and instrumentation: </span></strong><br>\r\nAQUA (EOS-PM1) is an afternoon equator-crossing platform which includes a suite of sensors designed to study the diurnal properties of cloud and aerosol radiative fluxes, cloud formation, and precipitation (MIMR, AIRS/AMSU-A/MHS, and MODIS-N) in conjunction with a wind scatter meter planned for the Japanese ADEOS-II spacecraft. MIMR, MODIS-N, and AIRS will contribute to studies of sea-ice extent and heat exchange with the atmosphere. Data from the EOS-PM1 platform and the sensors on the TRMM spacecraft will combined to assess the utility and accuracy of precipitation measurements. <br>\r\n<span style="text-decoration: underline;"><strong>For more about instruments and data: </strong></span> <br>\r\n<strong>1‐instruments </strong><br>\r\n<a href="https://aqua.nasa.gov/content/instruments" >https://aqua.nasa.gov/content/instruments</a><br>\r\n<strong>2‐ Data</strong> <br>\r\n<a href="https://aqua.nasa.gov/content/about-aqua" >https://aqua.nasa.gov/content/about-aqua</a><br>\r\n<a href="https://aqua.nasa.gov/content/images-data" >https://aqua.nasa.gov/content/images-data</a><br>', 2, '[ {\n    "id":"document",\n    "name":"Lunar Transfer Trajectory",\n    "version":"1.0",\n	"clock":{\n      "interval":"2017-04-25T20:02:25Z/2017-04-25T21:40:25Z",\n      "currentTime":"2017-04-25T20:02:25Z",\n      "multiplier":10,\n      "range":"LOOP_STOP",\n      "step":"SYSTEM_CLOCK_MULTIPLIER"\n  }},\n{  \n   "id": "lunarProbe",\n   "availabilit