(14, 'GOSE 15', 'NORAD ID: 36411<br>\nInt\'l Code: 2010-008A <br>\nSemi major axis: 42164.51 km<br>\nEccentricity: 0.0002 <br>\nPerigee: 35,784.2 km <br>\nApogee: 35,802.7 km <br>\nInclination: 0.1 degrees<br>\nRAAN: 106.05degrees<br>\nArgument of perigee: 48.68 degrees<br>\nMean anomaly: 205.29 degrees<br>\nMean motion: 1.00 rev/day<br>\nPeriod: 1436.08 minutes<br>\nLaunch date: March 4, 2010<br>\n<span style="text-decoration: underline;"><strong>Mission description and instrumentation:</strong></span><br>\nGOES 15, also known as GOES-P, is an American (NOAA) geostationary weather satellite that was launched by a Delta 4 rocket from Cape Canaveral on 04 March 2010 , Environmental Satellites which carry an imager, sounder, the Solar X-ray Imager (SXI), the Space Environment Monitor System (SEM) and a search and rescue transponder which relays distress signals to the ground. The SEM consists of two magnetometers; an Energetic Particle Sensor (EPS) composed of a High-Energy Proton and Alpha Detector (HEPAD), a Magnetosphere Electron Detector (MAGED), an Energetic Proton Electron and Alpha Detector (EPEAD), and a Magnetosphere Proton Detector (MAGPD); Energetic X-Ray Sensor (XRS) and Extreme Ultraviolet (EUV) sensors. <br>\n<span style="text-decoration: underline;"><strong>For more about instruments and data: </strong></span><br>\n<strong>1‐instruments</strong><br>\n<a href="http://www.ospo.noaa.gov/Operations/GOES/15/index.html">http://www.ospo.noaa.gov/Operations/GOES/15/index.html</a> <br>\n<strong>2‐ Data</strong> <br>\n<a href="http://www.ospo.noaa.gov/Products/index.html ">http://www.ospo.noaa.gov/Products/index.html </a><br>', 3, '[ {\n    "id":"document",\n    "name":"Lunar Transfer Trajectory",\n    "version":"1.0",\n	"clock":{\n      "interval":"2017-04-24T18:50:01Z/2017-04-25T18:46:01Z",\n      "currentTime":"2017-04-24T18:50:01Z",\n      "multiplier":10,\n      "range":"LOOP_STOP",\n      "step":"SYSTEM_CLOCK_MULTIPLIER"\n  }},\n{  \n   "id": "lunarProbe",\