(15, 'GPM', 'NORAD ID: 39574 <br>\nInt\'l Code: 2014-009C  <br>\nSemi major axis: 6777.77  km <br>\nEccentricity: 0.0012 <br>\nPerigee: 398.7 km <br>\nApogee: 414.8  km <br>\nInclination: 65.0  degrees <br>\nRAAN: 97.55  degrees <br>\nArgument of perigee: 48.68 degrees <br>\nMean anomaly: 69.77  degrees <br>\nMean motion: 15.56  rev/day <br>\nPeriod: 92.55 minutes <br>\nLaunch date: February 27, 2014 <br>\n<span style="text-decoration: underline;"><strong>Mission description and instrumentation:</strong></span><br>\nGPM (Global Precipitation Measurement) Core Observatory launched on February 27th, 2014 at 1:37pm EST from Tanegashima Space Center, Japan. Satellite fleet will help predict a range of natural cataclysms, from floods and cyclones to drought and famine. The GPM constellation includes satellites from the United States, Japan, France, India and Eumetsat, the European weather satellite agency. GPM will orbit at an altitude of 253 miles, or 407 kilometers, and fly between 65 degrees north and south latitude, peering into clouds, severe storms, cyclones and blizzards to gauge precipitation rates around the world. <br>\n<span style="text-decoration: underline;"><strong>For more about instruments and data: </strong></span><br>\n<strong>1‐instruments</strong> <br>\n<a href="https://pmm.nasa.gov/GPM/flight-project/spacecraft-and-instruments">https://pmm.nasa.gov/GPM/flight-project/spacecraft-and-instruments </a><br> \n<strong> 2‐ Data </strong><br>\n<a href="https://pmm.nasa.gov/data-access/downloads/gpm">https://pmm.nasa.gov/data-access/downloads/gpm </a><br>', 4, '[ {\n    "id":"document",\n    "name":"Lunar Transfer Trajectory",\n    "version":"1.0",\n	"clock":{\n      "interval":"2017-04-25T22:05:40Z/2017-04-25T23:37:40Z",\n      "currentTime":"2017-04-25T22:05:40Z",\n      "multiplier":10,\n      "range":"LOOP_STOP",\n      "step":"SYSTEM_CLOCK_MULTIPLIER"\n  }},\n{  \n   "id": "lunarProbe",\n   "availability":["2017-04-25T22:05:40Z/2017-04-25T23:37:40Z"],\n 