(16, 'JASON-3', 'NORAD ID: 41240 <br>\r\nInt\'l Code: 2016-002A <br> \r\nSemi major axis: 7715.88 km <br>\r\nEccentricity: 0.0012 <br>\r\nPerigee: 1,338.8 km <br>\r\nApogee: 1,351   km  <br>\r\nInclination: 66.4 degrees<br>\r\nRAAN: 230.84 degrees<br>\r\nArgument of perigee: 273.65 degrees<br>\r\nMean anomaly: 86.36 degrees<br>\r\nMean motion: 12.81 rev/day<br>\r\nPeriod: 112.42 minutes<br>\r\nLaunch date: January 17, 2016<br>\r\n<span style="text-decoration: underline;"><strong>Mission description and instrumentation:</strong></span><br>\r\nJason-3 is the fourth mission in U.S.-European series of satellite missions that measure the height of the ocean surface. Launched on January 17, 2016, the mission will extend the time series of ocean surface topography.\r\n The primary instrument on Jason-3 is a radar altimeter. The altimeter will measure sea-level variations over the global ocean with very high accuracy (as 1.3 inches or 3.3 centimeters, with a goal of achieving 1 inch or 2.5 centimeters). Continual, long-term, reliable data of changes in ocean surface topography will be generated and will be used by scientists and operational agencies (NOAA, European weather agencies, marine operators, etc.) for scientific research and operational oceanography for the benefit of society.<br>\r\n<span style="text-decoration: underline;"><strong>For more about instruments and data:</strong></span><br>\r\n<strong>1‐instruments</strong><br>\r\n<a href="https://sealevel.jpl.nasa.gov/technology/technologyinstrumentdescription/">https://sealevel.jpl.nasa.gov/technology/technologyinstrumentdescription/ </a><br>\r\n<strong>2‐ Data</strong><br>\r\n<a href="https://sealevel.jpl.nasa.gov/data/">https://sealevel.jpl.nasa.gov/data/ </a>', 5, '[ {\n    "id":"document",\n    "name":"Lunar Transfer Trajectory",\n    "version":"1.0",\n	"clock":{\n      "interval":"2017-04-25T20:32:11Z/2017-04-25T22:24:11Z",\n      "currentTime":"2017-04-25T20:32:11Z",\n      "multiplier":10,\n      "range":"LO