(17, 'OCO-2', 'NORAD ID: 40059 <br>\r\nInt\'l Code: 2014-035A  <br>\r\nSemi major axis: 7080km <br>\r\nEccentricity: 0.0002<br>\r\nPerigee: 708.6 km <br>\r\nApogee: 710.8 km  <br>\r\nInclination: 98.2 degrees<br>\r\nRAAN: 58.08 degrees<br>\r\nArgument of perigee: 99.58 degrees<br>\r\nMean anomaly: 260.56 degrees<br>\r\nMean motion: 14.57 rev/day<br>\r\nPeriod: 98.83 minutes<br>\r\nLaunch date: January July 2, 2014<br>\r\n<span style="text-decoration: underline;"><strong>Mission description and instrumentation:</strong></span><br>\r\nNASA successfully launched its first spacecraft dedicated to studying atmospheric carbon dioxide at 2:56 a.m. PDT (5:56 a.m. PDT) on Wednesday, July 2, 2014. Orbiting Carbon Observatory-2 (OCO-2) is NASA’s first dedicated Earth remote sensing satellite to study atmospheric carbon dioxide from space.\r\nOCO-2 will be collecting a great number of high-resolution measurements, which will provide a greater spatial distribution of CO2 over the entire globe, in short, a bigger, clearer, more complete picture of global CO2. These measurements will be combined with data from the ground-based network to provide scientists with the information that they need to better understand the processes that regulate atmospheric CO2 and its role in the carbon cycle. <br>\r\n<span style="text-decoration: underline;"><strong>For more about instruments and data:</strong></span><br>\r\n<strong>1‐instruments</strong><br>\r\n<a href="https://oco.jpl.nasa.gov/observatory/instrument/ ">https://oco.jpl.nasa.gov/observatory/instrument/ </a><br>\r\n<strong>2‐ Data</strong><br>\r\n<a href="https://oco.jpl.nasa.gov/science/OCO2DataCenter/">https://oco.jpl.nasa.gov/science/OCO2DataCenter/ </a><br>', 1, '[ {\n    "id":"document",\n    "name":"Lunar Transfer Trajectory",\n    "version":"1.0",\n	"clock":{\n      "interval":"2017-04-25T21:26:07Z/2017-04-25T23:04:07Z",\n      "currentTime":"2017-04-25T21:26:07Z",\n      "multiplier":10,\n      "range":"LOOP_STOP",\n      "step