(21, 'LAGEOS 1', '<p align="left"><span style="color: #000000;"><span style="font-family: Calibri-Bold, serif;"><span style="font-size: small;"><span style="font-family: \'Times New Roman\', serif;"><span style="font-size: large;">NORAD ID: 8820&nbsp;&nbsp;</span></span></span></span></span></p>\r\n<p align="left"><span style="color: #000000;"><span style="font-family: Calibri-Bold, serif;"><span style="font-size: small;"><span style="font-family: \'Times New Roman\', serif;"><span style="font-size: large;">Int\'l Code: 1976-039A&nbsp;</span></span></span></span></span></p>\r\n<p align="left"><span style="color: #000000;"><span style="font-family: Calibri-Bold, serif;"><span style="font-size: small;"><span style="font-family: \'Times New Roman\', serif;"><span style="font-size: large;">Semi major axis: 12271.19 km</span></span></span></span></span></p>\r\n<p align="left"><span style="color: #000000;"><span style="font-family: Calibri-Bold, serif;"><span style="font-size: small;"><span style="font-family: \'Times New Roman\', serif;"><span style="font-size: large;">Eccentricity: 0.0045</span></span></span></span></span></p>\r\n<p align="left"><span style="color: #000000;"><span style="font-family: Calibri-Bold, serif;"><span style="font-size: small;"><span style="font-family: \'Times New Roman\', serif;"><span style="font-size: large;">Perigee: 5,845.5 km&nbsp;<br /> Apogee: 5,954.9 km&nbsp; </span></span></span></span></span></p>\r\n<p align="left"><span style="color: #000000;"><span style="font-family: Calibri-Bold, serif;"><span style="font-size: small;"><span style="font-family: \'Times New Roman\', serif;"><span style="font-size: large;">Inclination: 9.83 degrees</span></span></span></span></span></p>\r\n<p align="left"><span style="color: #000000;"><span style="font-family: Calibri-Bold, serif;"><span style="font-size: small;"><span style="font-family: \'Times New Roman\', serif;"><span style="font-size: large;">RAAN: 115.44 degrees<br /> Argument of perigee: 297.08 degrees<br /> Mean anomaly: 322.53 degrees<br /> Mean motion: 6.39 rev/day<br /> Period: 225.47 minutes</span></span></span></span></span></p>\r\n<p align="left"><span style="color: #000000;"><span style="font-family: Calibri-Bold, serif;"><span style="font-size: small;"><span style="font-family: \'Times New Roman\', serif;"><span style="font-size: large;">Launch date: May 4,1976</span></span></span></span></span></p>\r\n<p align="left"><span style="color: #000000;"><span style="font-family: Calibri-Bold, serif;"><span style="font-size: small;"><strong><span style="font-family: \'Times New Roman\', serif;"><span style="font-size: large;"><u>Mission description and instrumentation:</u></span></span></strong></span></span></span></p>\r\n<p align="justify"><span style="color: #000000;"><span style="font-family: \'Times New Roman\', serif;"><span style="font-size: large;">LAGEOS-I is a</span></span></span><span style="font-family: \'Times New Roman\', serif;"><span style="font-size: large;">&nbsp;</span></span><span style="color: #000000;"><span style="font-family: \'Times New Roman\', serif;"><span style="font-size: large;">passive research satellite</span></span></span><span style="font-family: \'Times New Roman\', serif;"><span style="font-size: large;">&nbsp;</span></span><span style="color: #000000;"><span style="font-family: \'Times New Roman\', serif;"><span style="font-size: large;">of NASA - the orbit of the spacecraft (and its slight perturbations) represent the geodynamic measurements. LAGEOS-I is the first NASA satellite dedicated wholly to laser ranging. LAGEOS was designed to act as a permanent reference point so that the Earth\'s progress could be tracked relative to the satellite (in contrast to the traditional system of tracking satellites relative to the Earth). One of LAGEOS\' functions is to aid in the understanding of the Earth\'s crustal motions.</span></span></span></p>\r\n<p align="left"><span style="color: #000000;"><span style="font-famil