(22, 'LAGEOS 2', '<p align="left"><span style="color: #000000;"><span style="font-family: Calibri-Bold, serif;"><span style="font-size: small;"><span style="font-family: \'Times New Roman\', serif;"><span style="font-size: large;">NORAD ID: 22195</span></span></span></span></span></p>\r\n<p align="left"><span style="color: #000000;"><span style="font-family: Calibri-Bold, serif;"><span style="font-size: small;"><span style="font-family: \'Times New Roman\', serif;"><span style="font-size: large;">Int\'l Code: 1992-070B&nbsp;</span></span></span></span></span></p>\r\n<p align="left"><span style="color: #000000;"><span style="font-family: Calibri-Bold, serif;"><span style="font-size: small;"><span style="font-family: \'Times New Roman\', serif;"><span style="font-size: large;">Semi major axis: 12161.89 km</span></span></span></span></span></p>\r\n<p align="left"><span style="color: #000000;"><span style="font-family: Calibri-Bold, serif;"><span style="font-size: small;"><span style="font-family: \'Times New Roman\', serif;"><span style="font-size: large;">Eccentricity: 0.0137</span></span></span></span></span></p>\r\n<p align="left"><span style="color: #000000;"><span style="font-family: Calibri-Bold, serif;"><span style="font-size: small;"><span style="font-family: \'Times New Roman\', serif;"><span style="font-size: large;">Perigee: 11994.99 km&nbsp;<br /> Apogee: 12329.01 km&nbsp; </span></span></span></span></span></p>\r\n<p align="left"><span style="color: #000000;"><span style="font-family: Calibri-Bold, serif;"><span style="font-size: small;"><span style="font-family: \'Times New Roman\', serif;"><span style="font-size: large;">Inclination: 52.65 degrees</span></span></span></span></span></p>\r\n<p align="left"><span style="color: #000000;"><span style="font-family: Calibri-Bold, serif;"><span style="font-size: small;"><span style="font-family: \'Times New Roman\', serif;"><span style="font-size: large;">RAAN: 115.44 degrees<br /> Argument of perigee: 297.1 degrees<br /> Mean anomaly: 221.40 degrees<br /> Mean motion: 6.47 rev/day<br /> Period: 222.46 minutes</span></span></span></span></span></p>\r\n<p align="left"><span style="color: #000000;"><span style="font-family: Calibri-Bold, serif;"><span style="font-size: small;"><span style="font-family: \'Times New Roman\', serif;"><span style="font-size: large;">Launch date: October 22, 1992</span></span></span></span></span></p>\r\n<p align="left"><span style="color: #000000;"><span style="font-family: Calibri-Bold, serif;"><span style="font-size: small;"><strong><span style="font-family: \'Times New Roman\', serif;"><span style="font-size: large;"><u>Mission description and instrumentation:</u></span></span></strong></span></span></span></p>\r\n<p align="justify"><span style="color: #000000;"><span style="font-family: \'Times New Roman\', serif;"><span style="font-size: large;">LAGEOS-II: The satellite was deployed from the Space Shuttle (Columbia, STS-52) launch from Cape Canaveral: Oct. 22, 1992 (NASA). Italy developed and provided IRIS (Italian Research Interim Stage), a solid-fueled booster, which carried the satellite from the Shuttle\'s parking orbit into the required LAGEOS II orbit. The LAGEOS satellites are covered with 426 cube corner reflectors with all but four of these reflectors made with fused silica glass. The other four reflectors are made of germanium to obtain measurements in the infrared for experimental studies of reflectivity and satellite orientation.</span></span></span></p>\r\n<p align="left"><span style="color: #000000;"><span style="font-family: Calibri-Bold, serif;"><span style="font-size: small;"><strong><span style="font-family: \'Times New Roman\', serif;"><span style="font-size: large;"><u>For more about instruments and data</u></span></span></strong></span></span></span><span style="color: #000000;"><span style="font-family: \'Calibri bold\', serif;"><span style="font-size: medium;"><br /> </span></span></span><span style="color: #000000;">