(23, 'GRACE 1', '<p align="left"><span style="color: #000000;"><span style="font-family: Calibri-Bold, serif;"><span style="font-size: small;"><span style="font-family: \'Times New Roman\', serif;"><span style="font-size: large;">NORAD ID: 27391U<br /> Int\'l Code: 02012A&nbsp;<br /> Semi</span></span></span></span></span><span style="color: #000000;"><span style="font-family: Calibri-Bold, serif;"><span style="font-size: small;"><span style="font-family: \'Cambria Math\', serif;"><span style="font-size: large;">‐</span></span></span></span></span><span style="color: #000000;"><span style="font-family: Calibri-Bold, serif;"><span style="font-size: small;"><span style="font-family: \'Times New Roman\', serif;"><span style="font-size: large;">major axis: 6,713.88&nbsp;km<br /> Eccentricity: 0.0003<br /> Perigee: 6711.9&nbsp;km<br /> Apogee: 6715.8&nbsp;km<br /> Inclination: 88.99 degrees<br /> RAAN: 328.53degrees<br /> Argument of perigee: 201.2 degrees<br /> Mean anomaly: 218.78 degrees<br /> Mean motion: 15.78 rev/day<br /> Period: 91.25 minutes<br /> Launch date:&nbsp;March 17, 2002<br /></span></span></span></span></span></p>\n<p align="left"><span style="color: #000000;"><span style="font-family: Calibri-Bold, serif;"><span style="font-size: small;"><strong><span style="font-family: \'Calibri bold\', serif;"><span style="font-size: medium;"><u>Mission description and instrumentation:</u></span></span></strong></span></span></span></p>\n<p align="justify"><span style="color: #000000;"><span style="font-family: \'Times New Roman\', serif;"><span style="font-size: large;">GRACE Climate Experiment&nbsp;launched on March 17, 2002, their data have transformed scientists\' view of how water moves and is stored around the planet.</span></span></span></p>\n<p align="justify"><span style="color: #000000;"><span style="font-family: \'Times New Roman\', serif;"><span style="font-size: large;">GRACE measures changes in mass through their effects on twin satellites orbiting one behind the other about 137 miles apart (220 kilometers). The small accelerations and decelerations caused by changing mass below the spacecraft alter the distance between them very slightly, by a few microns .To measure this ever-changing distance, the spacecraft constantly beam microwave pulses at each other and time the arrival of returning signals.</span></span></span></p>\n<p align="left"><span style="color: #000000;"><span style="font-family: Calibri-Bold, serif;"><span style="font-size: small;"><strong><span style="font-family: \'Times New Roman\', serif;"><span style="font-size: large;"><u>For more about data</u></span></span></strong></span></span></span></p>\n<p align="left"><a href="https://grace.jpl.nasa.gov/data/get-data/">https://grace.jpl.nasa.gov/data/get-data/</a></p>\n<p align="left"><span style="color: #000000;"><span style="font-family: Calibri-Bold, serif;"><span style="font-size: small;"><span style="font-family: \'Times New Roman\', serif;"><span style="font-size: large;">&nbsp;</span></span></span></span></span></p>', 7, '[ {\n    "id":"document",\n    "name":"Lunar Transfer Trajectory",\n    "version":"1.0",\n	"clock":{\n      "interval":"2017-04-25T21:22:25Z/2017-04-25T22:53:25Z",\n      "currentTime":"2017-04-25T21:22:25Z",\n      "multiplier":10,\n      "range":"LOOP_STOP",\n      "step":"SYSTEM_CLOCK_MULTIPLIER"\n  }},\n{  \n   "id": "lunarProbe",\n   "availability":["2017-04-25T21:22:25Z/2017-04-25T22:53:25Z"],\n   "model" : {\n       "gltf" : "../Apps/LRO_spacecraft_with_materials.gltf",\n	   "scale" : 5000.0,\n       "show" : [{\n                "interval" : "2017-04-25T21:22:25Z/2017-04-25T22:53:25Z",\n                "boolean" : true\n            }]\n   },\n    "billboard" : {\n        "eyeOffset" : {\n            "cartesian" : [0.0, 0.0, 0.0]\n        },\n        "horizontalOrigin" : "CENTER",\n        "image" : "data:image/png;base64,",\n        "pixelOffset" : {\n            "cartesian2" : [0.0, 0.0]\n        },\n        "scale"