(24, 'METOP-A', '<p align="left"><span style="color: #000000;"><span style="font-family: Calibri-Bold, serif;"><span style="font-size: small;"><span style="font-family: \'Times New Roman\', serif;"><span style="font-size: large;">NORAD ID: 29499U<br /> Int\'l Code: 06044A&nbsp;<br /> Semi</span></span></span></span></span><span style="color: #000000;"><span style="font-family: Calibri-Bold, serif;"><span style="font-size: small;"><span style="font-family: \'Cambria Math\', serif;"><span style="font-size: large;">‐</span></span></span></span></span><span style="color: #000000;"><span style="font-family: Calibri-Bold, serif;"><span style="font-size: small;"><span style="font-family: \'Times New Roman\', serif;"><span style="font-size: large;">major axis: 7198.44 km<br /> Eccentricity: 0.0001<br /> Perigee: 7197.64km<br /> Apogee: 7199.15km<br /> Inclination: 98.68 degrees<br /> RAAN: 176.35 degrees<br /> Argument of perigee: 45.58 degrees<br /> Mean anomaly: 65.74 degrees<br /> Mean motion: 14.21 rev/day<br /> Period: 101.30 minutes<br /> Launch date:&nbsp;October 19, 2006<br /></span></span></span></span></span></p>\n<p align="left"><span style="color: #000000;"><span style="font-family: Calibri-Bold, serif;"><span style="font-size: small;"><strong><span style="font-family: \'Times New Roman\', serif;"><span style="font-size: large;"><u>Mission description and instrumentation:</u></span></span></strong></span></span></span></p>\n<p align="justify"><span style="color: #000000;"><span style="font-family: \'Times New Roman\', serif;"><span style="font-size: large;">METOP-A is Europe\'s first polar-orbiting weather satellite and will give forecasters a new perspective on weather phenomena. METOP-A will also work in tandem with the United States polar-orbiting satellite fleet managed by the National Oceanic and Atmospheric Administration.</span></span></span></p>\n<p align="justify"><span style="color: #000000;"><span style="font-family: \'Times New Roman\', serif;"><span style="font-size: large;">there are five heritage instruments provided by NOAA: The AVHRR radiometer for global imagery, the AMSU-A microwave "sounder", the HIRS infrared "sounder", an advanced ARGOS data collection system, and the SEM-2 particle spectrometer to monitor the energetic particles. The "sounders" are horizon-scanning passive instruments that enable inference of vertical profiles.</span></span></span></p>\n<p align="left"><span style="color: #000000;"><span style="font-family: Calibri-Bold, serif;"><span style="font-size: small;"><strong><span style="font-family: \'Times New Roman\', serif;"><span style="font-size: large;"><u>For more about instruments and data</u></span></span></strong></span></span></span></p>\n<p align="left"><span style="color: #000000;"><span style="font-family: Calibri-Bold, serif;"><span style="font-size: small;"><strong><span style="font-family: \'Times New Roman\', serif;"><span style="font-size: large;">1-Instruments </span></span></strong></span></span></span></p>\n<p align="left"><a href="http://www.ospo.noaa.gov/Operations/METOP/status.html#metop_a">http://www.ospo.noaa.gov/Operations/METOP/status.html#metop_a</a></p>\n<p align="left"><span style="color: #000000;"><span style="font-family: Calibri-Bold, serif;"><span style="font-size: small;"><strong><span style="font-family: \'Times New Roman\', serif;"><span style="font-size: large;">2-Data</span></span></strong></span></span></span></p>\n<p align="left"><a href="http://www.ospo.noaa.gov/Products/atmosphere/mspps/metopAprd.html">http://www.ospo.noaa.gov/Products/atmosphere/mspps/metopAprd.html</a></p>\n<p align="left"><span style="color: #000000;"><span style="font-family: Calibri-Bold, serif;"><span style="font-size: small;"><span style="font-family: \'Times New Roman\', serif;"><span style="font-size: large;">&nbsp;</span></span></span></span></span></p>', 8, '[ {\n    "id":"document",\n    "name":"Lunar Transfer Trajectory",\n    "version":"1.0",\n	"clock":{\n      "in